const Portfolio = () => {
	return (
		<section id="portfolio" className="pt-36 pb-16 bg-base-200" >
			<div className="container">
				<div className="w-full px-4">
					<div className="max-w-xl mx-auto text-center mb-16">
						<h4 className="font-semibold text-lg text-primary mb-2">Portfolio</h4>
						<h2 className="font-bold text-dark text-3xl mb-4">Project Terbaru</h2>
						<p className="font-medium text-base text-grey">Lorem ipsum dolor sit amet consectetur adipisicing elit. Ullam consequuntur minima soluta voluptatem laborum amet maxime asperiores quasi?</p>
					</div>
				</div>
			</div>
		</section>
	)
}

export default Portfolio;
